window.bookSummaryJSON = "<p><b>Alex is broke.</b></p> <p>He's pretty much always been broke. A misspent youth led to mistakes that led to convictions and plea deals. No career, no education, no hope.</p> <p>Now he has a chance to make things right for him and his family when the newest immersive MMO comes with the ability to convert money earned in the game into real currency. Well, it's cryptocurrency, but that's real-ish, right? Seeing an opportunity, Alex joins The Realms as Jack Alltrades, looking to make money any way he can. He may be a Master of None, but he's determined to learn every way possible to make money and turn his life around. Along the way, he'll find answers to important questions like:</p> <ul> <li>Can he win employee of the month?</li> <li>Do gnomes dream of electric sheep?</li> <li>How many kobolds does it take to swing a pickaxe?</li> <li>Can NPCs commit tax fraud?</li> </ul> <p>Okay, maybe he won't answer most of those, but that doesn't mean you shouldn't come follow the high-margin adventures of Jack Alltrades!</p>"; 
